import React from "react";

import "./Feedback.css";

function Feedback() {
  return (
    <div className="feedback">
      <h3 className="feedback-h3">Hi! I'm still building this app.</h3> Please
      leave your feedback to help it get better:
      <form className="feedback-form">
        <textarea
          name="feedback-text"
          id="feedback-text"
          cols="30"
          rows="10"
        ></textarea>
      </form>
    </div>
  );
}

export default Feedback;
